package com.melonlee.ewd.bean;public class AdminBean {	private Integer id;	private String userName;	private String userPwd;	private String lastLogin;	public Integer getId() {		return id;	}	public void setId(Integer id) {		this.id = id;	}	public String getUserName() {		return userName;	}	public void setUserName(String userName) {		this.userName = userName;	}	public String getUserPwd() {		return userPwd;	}	public void setUserPwd(String userPwd) {		this.userPwd = userPwd;	}	public String getLastLogin() {		return lastLogin;	}	public void setLastLogin(String lastLogin) {		this.lastLogin = lastLogin;	}}